import React from 'react';
import EmojiPicker from 'emoji-picker-react';

export default function messagingSend() {
    const [emoj, setEmoj] = eact.useState('emojClose');

    function emojiOpen() {
        if (emoj === 'emojClose') {
            setEmoj('emojOpen');
        } else if (emoj === 'emojOpen') {
            setEmoj('emojClose');
        }
    }

    function emoji() { }


    return (
        <div className="messagingSend">
            <div id="send">
                <textarea className="sendInput"></textarea>
                <div className="submit"><span>Send</span></div>
                <div className="emojiButton" onClick={emojiOpen()}><img src="./icons/icons_alien.png" className="emojiButton" /> </div>
            </div>
            <EmojiPicker className={emoj} onEmojiClick={emoji()} />
        </div>
    )
}
